import React, {Component} from 'react';
import './App.css';

class App extends Component{
  showInfoProduct(product){
    if(product.status){
      return <h3>
              ID : {product.id}<br/>
              Name : {product.name}<br/>
              Price : {product.price}<br/>
              status : {product.status ? 'Active' : 'Pending'}
            </h3>
    }
  }



  render(){
    var a = 5 ;
    var name = 'Tinh';
    var b =7;
    var product = {
      id : 1,
      name : 'Iphone 7 Plus',
      price : 15000000,
      status : true

    };


    var users =[

      {
        id : 1,
        name : 'ABC',
        tuoi : 18
      },
      {
        id : 2,
        name : 'XYZ',
        tuoi : 22
      },

      {
        id : 3,
        name : "JKG",
        tuoi : 30
      }
    ];

    var elements = users.map((user, index)=>{
      return  <div key={user.id}>
                <h2>Ten : {user.name}</h2>
                <p>Tuoi : {user.tuoi} </p>
              </div>
    });
      return (
        <div>
          <nav className="navbar navbar-inverse">
            <div className="container-fluid">
              <a className="navbar-brand">Title</a>
              <ul className="nav navbar-nav">
                <li className="active">
                  <a>Home</a>
                </li>
                <li>
                  <a>Link</a>
                </li>
              </ul>
            </div>
          </nav> 
          <div className="ml-30">
            <h2>
              a : {a} <br/>
              b : {b} <br/>
              a + b = {a+b}
            </h2>
            <h3>
              name : {name}
            </h3>

            {this.showInfoProduct(product)}
            <br/>
            <hr/>
            {elements}
          </div>
        </div> 
      );
  }

}

export default App;
